function Unidade({ units, isLoading }) {
  return isLoading ? (
    <h1>Loading</h1>
  ) : (
    <div>
      {units.map((units) => (
        <div key={units.id} item={units}></div>
      ))}
    </div>
  );
}

export default Unidade;
